import { AxiosRequestConfig, AxiosInstance } from 'axios';
import HttpClient from './HttpClient';
import HttpClientReponse from './HttpClientResponse';
export default class HttpClientAxios implements HttpClient {
    client: AxiosInstance;
    constructor(options?: AxiosRequestConfig);
    get<T>(url: string): Promise<HttpClientReponse<T>>;
    post<T>(url: string, data: object): Promise<HttpClientReponse<T>>;
}
